import React from "react";
const Navbar = () => {
  return (
    <nav class="navbar navbar-light bg-success pb-6">
      <a href="/">Home</a>

      <a href="/about">About</a>

      <a href="/product">Product</a>
      <a href="/sign">sign</a>
    </nav>
  );
};

export default Navbar;
